import React from "react";
import "./DashboardNavbar.css";
import { Container, Nav, Navbar } from "react-bootstrap";
import { Link, NavLink } from "react-router-dom";
import logo from "../Images/penguin-logo-full.png";
import Tilty from "react-tilty";
import { Fade } from "react-reveal";

const DashboardNavBar = () => {
  return (
    <Navbar collapseOnSelect expand="xl" variant="dark" className="navbar-bg">
      <Navbar.Brand as={Link} to="/" className="justify-content-baseline">
        <Fade>
          <Tilty max="1" scale={1.05}>
            <img src={logo} alt="penguin-icon" />
          </Tilty>
        </Fade>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse
        id="responsive-navbar-nav"
        className="justify-content-start"
      >
        <Nav>
          <Nav.Item>
            <Nav.Link
              as={Link}
              to="/dashboard"
              className="text-nowrap"
              onClick={() => {
                console.log("dashboard button clicked!")
              }}
            >
              Trade
            </Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link
              as={Link}
              to="/trade"
              className="text-nowrap"
              onClick={() => {
                console.log("trade button clicked!")
              }}
            >
              Trade
            </Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link
              as={Link}
              to="/portfolio"
              onClick={() => {
                console.log("portfolio button clicked!")
              }}
            >
              Portfolio
            </Nav.Link>
          </Nav.Item>

        </Nav>
      </Navbar.Collapse>
          <Nav.Item>
            <Nav.Link
              as={Link}
              to="/"
              onClick={() => {
                console.log("logout button clicked!")
              }}
            >
              Logout
            </Nav.Link>
          </Nav.Item>
    </Navbar>
  );
};

export default DashboardNavBar;
